"use strict";(self.webpackChunkdocs=self.webpackChunkdocs||[]).push([[581],{5610:e=>{e.exports=JSON.parse('{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","label":"Intro to Chirp Wireless","href":"/intro","docId":"intro","unlisted":false},{"type":"category","label":"What is LoRaWAN?","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Sub Ghz Frequencies","href":"/LoRaWAN/subg","docId":"LoRaWAN/subg","unlisted":false},{"type":"link","label":"LoRa 2.4Ghz","href":"/LoRaWAN/2g4","docId":"LoRaWAN/2g4","unlisted":false},{"type":"link","label":"Chirps IoT Gateway","href":"/LoRaWAN/Gateway/","docId":"LoRaWAN/Gateway/gateway","unlisted":false},{"type":"link","label":"Benefits of Lora and LoRaWAN","href":"/LoRaWAN/lorabenefits","docId":"LoRaWAN/lorabenefits","unlisted":false},{"type":"link","label":"Examples of LoRaWAN applications","href":"/LoRaWAN/applications","docId":"LoRaWAN/applications","unlisted":false},{"type":"link","label":"LoRaWAN frequencies by country","href":"/LoRaWAN/frequencies","docId":"LoRaWAN/frequencies","unlisted":false}],"href":"/LoRaWAN/"},{"type":"category","label":"IoT Platform","collapsible":true,"collapsed":true,"items":[{"type":"category","label":"Adding gateways to Chirp Network","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Browan TBMH110","href":"/Dashboard/Adding Gateways to Chirp Network/Browantbmh110","docId":"Dashboard/Adding Gateways to Chirp Network/Browantbmh110","unlisted":false},{"type":"link","label":"RAK WisGate Edge","href":"/Dashboard/Adding Gateways to Chirp Network/RAK WisGate Edge","docId":"Dashboard/Adding Gateways to Chirp Network/RAK WisGate Edge","unlisted":false},{"type":"link","label":"RAK 7268 V2","href":"/Dashboard/Adding Gateways to Chirp Network/RAK7268V2","docId":"Dashboard/Adding Gateways to Chirp Network/RAK7268V2","unlisted":false}],"href":"/Dashboard/Adding Gateways to Chirp Network/"},{"type":"category","label":"Cellular IoT","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"SIM Cards Types","href":"/Dashboard/Cellular IoT/simcardtypes","docId":"Dashboard/Cellular IoT/simcardtypes","unlisted":false},{"type":"link","label":"What is Cerllular IoT?","href":"/Dashboard/Cellular IoT/cellularconnectivity","docId":"Dashboard/Cellular IoT/cellularconnectivity","unlisted":false}]}],"href":"/Dashboard/"},{"type":"link","label":"Security","href":"/Security/","docId":"Security/security","unlisted":false},{"type":"link","label":"Terms of Use","href":"/Terms of Use/","docId":"Terms of Use/Terms of Use","unlisted":false},{"type":"link","label":"Privacy Policy","href":"/Privacy Policy/","docId":"Privacy Policy/Privacy Policy","unlisted":false}]},"docs":{"Dashboard/Adding Gateways to Chirp Network/Adding Gateways to Chirp Network":{"id":"Dashboard/Adding Gateways to Chirp Network/Adding Gateways to Chirp Network","title":"Adding gateways to Chirp Network","description":"Adding a LoRaWAN Gateway to Chirp Network","sidebar":"tutorialSidebar"},"Dashboard/Adding Gateways to Chirp Network/Browantbmh110":{"id":"Dashboard/Adding Gateways to Chirp Network/Browantbmh110","title":"Browan TBMH110","description":"Ensure that your model ends with 110, as the model 100 is not compatible with the Chirp Network.","sidebar":"tutorialSidebar"},"Dashboard/Adding Gateways to Chirp Network/RAK WisGate Edge":{"id":"Dashboard/Adding Gateways to Chirp Network/RAK WisGate Edge","title":"RAK WisGate Edge","description":"RAK WisGate Edge","sidebar":"tutorialSidebar"},"Dashboard/Adding Gateways to Chirp Network/RAK7268V2":{"id":"Dashboard/Adding Gateways to Chirp Network/RAK7268V2","title":"RAK 7268 V2","description":"Step 1","sidebar":"tutorialSidebar"},"Dashboard/Cellular IoT/cellularconnectivity":{"id":"Dashboard/Cellular IoT/cellularconnectivity","title":"What is Cerllular IoT?","description":"Cellular IoT connectivity refers to the ability of IoT (Internet of Things) devices to connect and communicate using cellular networks, which are widely available in almost every country around the world. This connectivity option offers several advantages, including reliable coverage and connectivity due to the extensive reach of cellular networks.","sidebar":"tutorialSidebar"},"Dashboard/Cellular IoT/simcardtypes":{"id":"Dashboard/Cellular IoT/simcardtypes","title":"SIM Cards Types","description":"Discover the intricacies of SIM cards, their classifications, applications, quality measures, and formats.","sidebar":"tutorialSidebar"},"Dashboard/dashboard":{"id":"Dashboard/dashboard","title":"IoT Platform","description":"An IoT platform is a software solution that allows users to control their IoT devices and visualize, and analyze data collected from IoT devices in a user-friendly and intuitive manner. It serves as a central hub for managing and monitoring IoT devices, presenting the data in a visual format that is easily understandable and actionable.","sidebar":"tutorialSidebar"},"intro":{"id":"intro","title":"Intro to Chirp Wireless","description":"Chirp Wireless is a leading global wireless network provider that offers reliable and extensive IoT connectivity solutions, both outdoors and indoors. Leveraging Semtech\'s SX1303 chip and Time Difference of Arrival (TDOA) technology, Chirp enables long-range outdoor IoT connectivity and geo-positioning without the need for GPS. Additionally, Chirp provides businesses and Mobile Virtual Network Operators (MVNOs) the opportunity to integrate with our global Radio Access Network (RAN), offering white-label solutions and software that handle IoT and connectivity, allowing businesses to focus on sales and automation.","sidebar":"tutorialSidebar"},"LoRaWAN/2g4":{"id":"LoRaWAN/2g4","title":"LoRa 2.4Ghz","description":"On the other hand, LoRa 2.4GHz refers to the use of the 2.4 GHz frequency band for LoRa communication. This frequency band is globally available and license-free in all countries. It is commonly used by technologies like Wi-Fi and Bluetooth. The advantage of using 2.4GHz for IoT is that devices from one country can work in another without frequency compatibility issues. This frequency band offers higher data rates and compatibility with existing infrastructure, making it suitable for shorter-range IoT deployments.","sidebar":"tutorialSidebar"},"LoRaWAN/applications":{"id":"LoRaWAN/applications","title":"Examples of LoRaWAN applications","description":"Examples of LoRaWAN applications are abundant. In agriculture, LoRaWAN can be used to monitor soil moisture levels, weather conditions, crop health, and livestock tracking across vast agricultural landscapes. Asset tracking becomes seamless with LoRaWAN, enabling real-time monitoring and tracking of vehicles, containers, and equipment in logistics and supply chain operations. Smart cities benefit from LoRaWAN-enabled solutions for smart street lighting, waste management, parking management, air quality monitoring, and other applications aimed at enhancing urban efficiency and sustainability. Industrial IoT applications can leverage LoRaWAN for remote machine monitoring, predictive maintenance, and logistics tracking in challenging industrial environments. Building automation is also made smarter with LoRaWAN, enabling energy management, occupancy sensing, security systems, and intelligent lighting control within buildings.","sidebar":"tutorialSidebar"},"LoRaWAN/frequencies":{"id":"LoRaWAN/frequencies","title":"LoRaWAN frequencies by country","description":"Chirp\'s network is designed to accommodate multiple communication protocols, including the global availability of LoRa 2.4 GHz. However, our gateways are also equipped to support local LoRa frequency bands based on specific regions. Frequency bands can vary significantly depending on the geographical location. To determine the frequency band used in your country, please refer to the information provided below.","sidebar":"tutorialSidebar"},"LoRaWAN/Gateway/gateway":{"id":"LoRaWAN/Gateway/gateway","title":"Chirps IoT Gateway","description":"An IoT gateway is a device that serves as a bridge between IoT devices and the cloud or network infrastructure. It acts as a central hub, facilitating communication, data transfer, and management between the devices and the IoT platform or applications.","sidebar":"tutorialSidebar"},"LoRaWAN/lorabenefits":{"id":"LoRaWAN/lorabenefits","title":"Benefits of Lora and LoRaWAN","description":"Low Power Consumption","sidebar":"tutorialSidebar"},"LoRaWAN/lorawan":{"id":"LoRaWAN/lorawan","title":"What is LoRaWAN?","description":"LoRaWAN is a protocol designed for long-range, low-power communication in IoT applications. It utilizes LoRa modulation technology and Chirp Spread Spectrum (CSS) to enable robust and efficient transmission. CSS is a modulation technique that spreads the signal across a wide frequency range, allowing for long-range communication, improved interference immunity, and low power consumption.","sidebar":"tutorialSidebar"},"LoRaWAN/subg":{"id":"LoRaWAN/subg","title":"Sub Ghz Frequencies","description":"LoRa Sub-GHz frequencies refer to the frequency bands below 1 GHz that are used for LoRa communication. The specific sub-GHz frequency bands used may vary between countries due to regulatory differences. For example, in Europe, the 868 MHz band is commonly used, while in North America, the 915 MHz band is prevalent. These sub-GHz frequencies offer excellent range and penetration capabilities, making them suitable for long-range IoT applications.","sidebar":"tutorialSidebar"},"Privacy Policy/Privacy Policy":{"id":"Privacy Policy/Privacy Policy","title":"Privacy Policy","description":"The protection of personal data and the responsible handling of information that you entrust to us is an important and special concern for us. Chirp processes personal data only in accordance with the statutory regulations, in particular Regulation (EU) 2016/679 (General Data Protection Regulation, \\"GDPR\\") and the German Federal Data Protection Act (BDSG).","sidebar":"tutorialSidebar"},"Security/security":{"id":"Security/security","title":"Security","description":"IoT security is indeed a significant concern, particularly in government and medical applications where the protection of sensitive data and critical systems is paramount. Traditional Wi-Fi IoT networks have been known to be susceptible to various security vulnerabilities and attacks, which can compromise the integrity and confidentiality of IoT deployments.","sidebar":"tutorialSidebar"},"Terms of Use/Terms of Use":{"id":"Terms of Use/Terms of Use","title":"Terms of Use","description":"PLEASE READ THESE TERMS OF USE (\\"terms of use\\") CAREFULLY. This website and the information on it are controlled by Chirp. These terms of use govern the use of the website and apply to all internet users visiting the website by accessing or using the website in any way, including the services and resources available or enabled via the website.","sidebar":"tutorialSidebar"}}}')}}]);